import React from "react";
import {useNavigate} from "react-router-dom";

import gif1 from "../../assets/scenarios1.gif";

function ScenariosIntroPage() {
    const navigate = useNavigate();

    return (
        <div className="WelcomePage">
            <div className={"WelcomeTitle"}>Create a deal set based on your own scenarios!</div>
            <img src={require("../../assets/scenarios1.gif").default} alt="Scenarios" className={"WelcomeImage"}/>
            <button
                className={"AnyButton ToggleScenariosViewButton GoToMakeButton WelcomePageNavigButton"}
                onClick={() => navigate('/scenarios/make')}>
                Make a scenario!
            </button>
            <button
                className={"AnyButton ToggleScenariosViewButton GoToMakeButton WelcomePageNavigButton"}
                onClick={() => navigate('/scenarios/use')}>
                Make a deal set!
            </button>
            <button
                className={"AnyButton ToggleScenariosViewButton GoToMakeButton WelcomePageNavigButton"}
                onClick={() => navigate('/scenarios/savedscenarios')}>
                Saved scenarios
            </button>
            <button
                className={"AnyButton ToggleScenariosViewButton GoToMakeButton WelcomePageNavigButton"}
                onClick={() => navigate('/scenarios/saveddealsets')}>
                Saved deal sets
            </button>
        </div>
    );
}

export default ScenariosIntroPage;
